import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the product cards to be dynamically loaded onto the page
    await page.waitForSelector('.product-card', { timeout: 10000 });

    // Locate the first product card on the page
    const firstProductCard = page.locator('.product-card').first();

    // Extract the title of the first product for later verification
    const productTitle = await firstProductCard.locator('.product-title').textContent();

    // Locate the "Add to Cart" button within the first product card
    const addToCartButton = firstProductCard.getByRole('button', { name: 'Add to Cart' });
    await addToCartButton.scrollIntoViewIfNeeded();

    // Take a screenshot before clicking the button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_add_to_cart.png'));

    // Click the "Add to Cart" button
    await addToCartButton.click();

    // Wait for the success notification to appear, confirming the click was processed
    await page.waitForSelector('.notification.success:visible');

    // Take a screenshot after the item has been added to the cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_add_to_cart.png'));

    // Verify the action by checking the browser's localStorage, which is updated by the script
    const cartData = await page.evaluate(() => localStorage.getItem('amazonCart'));
    const cart = JSON.parse(cartData);

    const addedItem = cart.find(item => item.title === productTitle.trim());

    if (!addedItem || addedItem.quantity !== 1) {
      throw new Error('Product was not found or has incorrect quantity in localStorage cart.');
    }

    const notificationText = await page.locator('.notification.success').textContent();

    return {
      success: true,
      action: "Added the first product to the cart and verified the update in localStorage.",
      extractedData: {
        productAdded: addedItem.title,
        quantityInCart: addedItem.quantity,
        notificationMessage: notificationText.trim(),
        cartContents: cart
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add the first product to the cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
